                if (shiftDown) {
                        let p1 = "Formula:" + br + format(tmp.mu.requires, 0) + "*"
                        p1 += formatWhole(tmp.mu.base) + "^(x<sup>" + formatWhole(tmp.mu.exponent)
                        p1 += "</sup>)"
                        return p1
                }

